import Waterfall from '../components/Waterfall'

const App = () => (
  <div className="container">
    <Waterfall
      renderItem={
        <CardBook
            post={{
                title: 'title',
                image: '//aa',
                type: 'image',
                user: {
                    username: 'username',
                    avatar: '//aa'
                },
                count: {
                    likes: 1
                }
            }}
        />
      }
      dataSource={[
          {
            title: 'title',
            image: '//aa',
            type: 'image',
            user: {
                username: 'username',
                avatar: '//aa'
            },
            count: {
                likes: 1
            }
        },
        {
          title: 'title',
          image: '//aa',
          type: 'image',
          user: {
              username: 'username',
              avatar: '//aa'
          },
          count: {
              likes: 1
          }
        }
      ]}
    />
  </div>
)

export default App
